        size_t fbe_field_size;

        uid.fbe_offset(fbe_current_offset);
        fbe_field_size = uid.get(fbe_value.uid);
        fbe_current_offset += fbe_field_size;
        fbe_current_size += fbe_field_size;

        name.fbe_offset(fbe_current_offset);
